  `numberOfTourMembers` int NOT NULL,
  `startingDate` datetime NOT NULL,
  `endingDate` datetime NOT NULL,
  `tourStatus` varchar(45) NOT NULL,
  `totalTourCharge` double NOT NULL,
  `currencyId` int NOT NULL,
  `guestId` int NOT NULL,
  `guideId` int NOT NULL,
  `vehicleId` int NOT NULL,
  `createdUserId` int NOT NULL,
  `driverId` int NOT NULL,
  PRIMARY KEY (`tourId`),
  KEY `currencyFKTour_idx` (`currencyId`),
  KEY `guestFKTour_idx` (`guestId`),
  KEY `guideFKTour_idx` (`guideId`),
  KEY `vehicleFKTour_idx` (`vehicleId`),
  KEY `userFKTour_idx` (`createdUserId`),
  KEY `driverFKTour` (`driverId`),
  CONSTRAINT `currencyFKTour` FOREIGN KEY (`currencyId`) REFERENCES `currency` (`currencyId`),
  CONSTRAINT `driverFKTour` FOREIGN KEY (`driverId`) REFERENCES `driver` (`driverId`),
  CONSTRAINT `guestFKTour` FOREIGN KEY (`guestId`) REFERENCES `guest` (`guestId`),
  CONSTRAINT `guideFKTour` FOREIGN KEY (`guideId`) REFERENCES `guide` (`guideId`),
  CONSTRAINT `userFKTour` FOREIGN KEY (`createdUserId`) REFERENCES `user` (`userId`),
  CONSTRAINT `vehicleFKTour` FOREIGN KEY (`vehicleId`) REFERENCES `vehicle` (`vehicleId`)
) ENGINE=InnoDB AUTO_INCREMENT=47 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
